import axios from 'axios';

function makeGetRequest(url) {
    let res = axios.get(url);
    let data = res.data;
    // console.log(data)
    return data;
}

export const fetchData = (url) => {

    const jsonData = makeGetRequest('http://127.0.0.1:3000/api/v1/' + url);
    var res = []

    jsonData
        .then((data) => {
            console.log(data);
            // return data
        })
        .catch((err) => console.log(err))
    
    return jsonData;

 

}
